import React from "react";
import "./App.css";

import QuoteBox from "./Components/QuoteBox";
import Footer from "./Components/Footer";

class App extends React.Component {
  render() {
    return (
      <div className="App" id="quotebox">
        <QuoteBox />
        <Footer />
      </div>
    );
  }
}

export default App;
